  "오늘(37) 당신은 지나간 선택을 돌아보게 될지도 몰라요.\n그 선택이 옳았는지가 아니라\n당신이 그때 어떤 마음이었는지를 들여다보게 될 거예요.\n자책이 아닌 이해로 바라본다면,\n지금의 당신은 그 시절보다 훨씬 더 다정해졌어요.\n그리고 그건, 앞으로 나아갈 힘이 될 거예요.",
